|Game Description|
+----------------+

Liberate your fellow dwarves with Match-3 gaming! Complete Hidden Object and Click Point tasks to escape the earth's core, return to happy, fertile valley, and reclaim the pendulum of dreams stolen by an evil magician!

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

- Windows 2000, Windows Vista, Windows XP, Windows 7

- Pentium-III processor speed

- 128 MB RAM

- 32 MB VRAM 16 or 32-bit Video Card

- 16 bit DirectX compatible sound card

- DirectX 7.0

